import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Cards from "./Cards";
import "./index.css";
import Sdata from "./Sdata";

function Merge() {
  return (
    <>
      <h1 className="heading_style">My top 5 netflix Series</h1>
      <Cards
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link}
      />
      <Cards
        imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        link={Sdata[1].link}
      />
      <Cards
        imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        link={Sdata[2].link}
      />
      <Cards
        imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        sname={Sdata[1].sname}
        link={Sdata[1].link}
      />
    </>
  );
}

ReactDOM.render(<Merge />, document.getElementById("root"));
